import React from "react";
import PictureCard from "../Components/PictureCard";

const Skills = (props) => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="home grid grid-cols-3 gap-4 w-[80%] ml-52 pt-20 bg-slate-500">
        <h1 className="col-span-3 text-4xl font-bold text-center">Skills</h1>
        <PictureCard />
        <PictureCard />
        <PictureCard />
      </div>
    </div>
  );
};

export default Skills;
